import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Form from 'react-bootstrap/Form';
import Offcanvas from 'react-bootstrap/Offcanvas';
import Button from 'react-bootstrap/Button';
import FormControl from 'react-bootstrap/FormControl';
import Search from './search.js';
import Menu from './menu.js';
import 'bootstrap/dist/css/bootstrap.min.css';

class Header extends React.Component {
  render(){
    //SETTINGS
    const search = 'Поиск';
    const link = 'Ссылка';
    //PROPS
    // logo = "./content/main/cherry.svg";
    // id = 'header'
    // market_name = 'Smokey Cherry'

    return(
      <Navbar key={this.props.id} variant="dark" bg="dark" expand={this.props.id} className="mb-3">
      <Container fluid>
        <Navbar.Brand href="#"><img className="img-fluid" src={this.props.logo} height="35" width="35"/>{this.props.market_name}</Navbar.Brand>
        
        <Menu />
      </Container>
    </Navbar>
    );
  }
}

export default Header;
